import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProfileSearch from './ProfileSearch';

function App() {
    return (
        <>
        <p>Hi!</p>
        <Router>
            <Routes>
                <Route path="/" element={<ProfileSearch />} />
            </Routes>
        </Router>
        </>
    );
}
export default App;
